func f_gold (s:String):String{
  let l = s.size
  var s1 = ""
  let isEven = if(l % 2 == 0){true}else{false}
  for (i in 0..l:2) {
    if ( isEven ) {
      s1 = Char(s[i]).toString() + s1
      s1 += Char(s[i+1]).toString()
    }
    else {
      if ( l - i > 1 ) {
        s1 += Char(s[i]).toString()
        s1 = Char(s[i+1]).toString() + s1
      }
      else {
        s1 += Char(s[i]).toString()
      }
    }
  }
  return s1
}

